if(JSON.parse(localStorage.getItem('dark')).checkedA==true){
  console.log("hello");
}else if(JSON.parse(localStorage.getItem('dark')).checkedA==false){
  console.log()
}






ReactDOM.render(
  <BrowserRouter>
      <App />
    </BrowserRouter>
,
  document.getElementById('root')
